  return (
    <>

<Box sx={{ backgroundColor: darkMode ? "#222" : "#fff", minHeight: "100vh" }}>
  <Navbar darkMode={darkMode} setDarkMode={setDarkMode} />
  {/* Other components */}
</Box>

    <BrowserRouter>
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route path="/login" element={<Login />} />
        <Route path="/register" element={<Register />} />
        <Route
          path="/dashboard"
          element={
            <ProtectedRoute>
              <Dashboard />
            </ProtectedRoute>
          }
        />
      </Routes>
    </BrowserRouter>
    </>

  );
}

export default App;
